{
  // Place your snippets for javascript here. Each snippet is defined under a snippet name and has a prefix, body and
  // description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
  // $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the
  // same ids are connected.
  // Example:
  "Print to console": {
    "prefix": "cc",
    "body": ["console.log('$1');"],
    "description": "输出 console.log"
  },
  "Print to ======": {
    "prefix": "ccp",
    "body": [
      "'=============================================================='"
    ],
    "description": "输出 ==========="
  },
  "api get ": {
    "prefix": "aget",
    "body": [" export const handle_$1 = (params, url='$1') => axios.get(`\\${prefix}\\${url}`, { params: {...params } });"],
    "description": "API get 模板"
  },
  "api post ": {
    "prefix": "apost",
    "body": [" export const handle_$1 = (params, url='$1') => axios.post(`\\${prefix}\\${url}`, params);"],
    "description": "API post 模板"
  },

  "api export ": {
    "prefix": "aexport",
    "body": ["export * as api_$1 from \"src/api/module/$1.js\""],
    "description": "API export 模板"
  },



}
